from typing import List
from scipy.stats import gmean

class Solution:

    def minimumCost(self, nums: List[int]) -> int:

        mid = round(gmean(nums))
        low = mid // 2
        high = mid * 2
        
        while True:
            
            print("ranges=>", low, mid, high)

            my_pal_low = Solution.nearest_pal(low)
            my_pal_mid = Solution.nearest_pal(mid)
            my_pal_high = Solution.nearest_pal(high)
            print("my_pals=>", my_pal_low, my_pal_mid, my_pal_high)
            
            sum_low = Solution.special_sum(nums, my_pal_low)
            sum_mid = Solution.special_sum(nums, my_pal_mid)
            sum_high = Solution.special_sum(nums, my_pal_high)
            print("my_sums=>", sum_low, sum_mid, sum_high)

            if abs(low - high) < 2:
                return min(sum_low, sum_mid, sum_high)

            min_sum = min(sum_low, sum_mid, sum_high)
            max_sum = max(sum_low, sum_mid, sum_high)            

            if min_sum == max_sum:
                return min_sum
            
            if min_sum == sum_mid:
                low = (low + mid) // 2
                high = (mid + high) // 2
            elif min_sum == sum_low:
                high = mid
                mid = low                
                low = low * 2 - high
            else:
                low = mid
                mid = high
                high = high * 2 - low            

    def nearest_pal(num: int) -> int:

        digits = [int(d) for d in str(num)]

        for i in range(len(digits)//2):
            digits[len(digits) - i - 1] = digits[i]

        ret_val = 0
        
        for i in range(len(digits)):
            ret_val *= 10
            ret_val += digits[i]

        #print(ret_val)
        
        return ret_val

    def special_sum(nums: List[int], my_pal: int) -> int:
        
        ret_val = 0
        
        for i in range(len(nums)):
            ret_val += abs(nums[i] - my_pal)

        return ret_val
        

